class Solution(object):
    def isPalindrome(self, s):
        """
        :type s: str
        :rtype: bool
        """
        letters = list(s.replace(" ", ""))
        start = 0
        end = len(letters) - 1

        while start < end:
            if not letters[start].isalnum():
                letters.pop(start)
                end = len(letters) - 1
            elif not letters[end].isalnum():
                letters.pop(end)
                end -= 1
            elif (letters[start]).lower() != (letters[end]).lower():
                return False
            else:
                letters.pop(end)
                letters.pop(start)
                end = len(letters) - 1
        if len(letters) <= 1:
            return True

